import React from "react";
import ReactDOM from "react-dom";

import "../index.css";

const Nav = () => (
        <div id="top-banner">
                     <div className="link">
                         <a href="/">Home</a>
                         <a href="/About">About</a>
                         <a href="/FAQ">FAQ</a>
                         <a href="/Rules">Rules</a>
                     </div>
                 </div>
 )

const rootElement = document.getElementById("navi");
ReactDOM.render(<Nav />, rootElement); 
export default Nav;
